import React, {useState}from 'react'

export default function State() {
    
    const [value,setValue]=useState()
    fetch("https://jsonplaceholder.typicode.com/posts")
    .then((res)=>res.json())
    .then((data)=>setValue(data))
    function update(){
        setValue(data)
    }
  return (
    <div>
        <button onClick={update}>+</button>
     {value.map((pst)=>(
        <>
<h1>{pst.titre}</h1>
</>
     ))}

  </div>
  )
}













